import React, { Fragment } from 'react'
import { useParams } from 'react-router'

function QuoteDetails() {
    const params = useParams
    return (
        <Fragment>
 <h1>Quotes component</h1>
            <h2>{params.quotesId}</h2>


        </Fragment>
           
                      
        
    )
}

export default QuoteDetails
